import React from 'react';
import Info from '../../component/info'


const Auth = (props)=>{


    return (
<div>
    <h1>Hi This is {props.appData}</h1>
<Info  name ="Ankush" age ="30"   />

</div>

    )



}

Auth.getIntialProps =(context)=>{


    const promise = new Promise((resolve,reject) =>{

        setTimeout(()=>{
            resolve({appData: "User App"});
        }, 1000)
    })
                return promise ;

}


export default Auth;
